import React from 'react';
import DensityMediumIcon from '@mui/icons-material/DensityMedium';
import VideoCallIcon from '@mui/icons-material/VideoCall';
import AssignmentIndOutlinedIcon from '@mui/icons-material/AssignmentIndOutlined';
//import { Link } from 'react-router-dom';
const HeaderPage = () =>{
 return ( 
       
    <div className="flex items-center w-full  h-[60px] bg-white fixed inset-x-0 top-0 shadow-md">

        <div className="w-max-[180px]">

            <button className="flex justify-center items-center ml-4 mt-1 w-10 h-10 hover:bg-gray-300 rounded-full">
                <DensityMediumIcon />
            </button>
            
        </div>

        <div className="mx-auto flex items-center ">

            <input
                type="text"
                placeholder="Tìm kiếm"
                className=" w-[550px] h-[40px] px-2 py-1 pl-4 pr-4 border border-gray-300 rounded-full placeholder-gray-400 focus:outline-none focus:ring-1 focus:ring-blue-500 focus:border-blue-500 sm:text-sm"
            />

        </div>

        <div className="w-max-[180px] flex">
        
            <button 
                className="flex justify-center items-center mr-4 mt-1 w-10 h-10 hover:bg-gray-300 rounded-full" 
                title="Tạo Video"
            > 
                <VideoCallIcon />
            </button>

            <button 
                className="flex justify-center items-center text-blue-500 mr-4 mt-1 w-[100px] h-10 hover:bg-blue-100 rounded-full border border-blue-500" 
            
            > 
                <AssignmentIndOutlinedIcon className="mr-2" />
                Sign in
            </button>
            
        </div>

    </div>
 );
    };
export default HeaderPage;
